import TelaRecall from "./TelaRecall.js";


export default function TelaInicial() {
    let [tela, setTela] = React.useState(TelaInicial);

    return (
        <div className="tela-inicial">
            <img src="./assets/img/logo.png" alt="logo ZapRecall" />
            <h1>ZapRecall</h1>
            <button onClick={() => setTela(TelaRecall)}>Iniciar Recall!</button>
        </div>
    )
}
